  componentDidMount() {
    // this.getUser()
  }

  getUser() {
    fetch(`https://torre.bio/api/bios/${this.state.currentProfile}`)
      .then(resp => {
        console.log(resp)
        this.setState({ userArray: resp.person })
      })
      .catch(error => console.error("sorry, something went wrong:" + error))
  }
  
  getUserConnections () {
    fetch(`https://torre.bio/api/people/${this.state.currentProfile}/connections?limit=100`)
      .then(resp => {
        console.log(resp)
        this.setState({ connectionsArray: resp.person })
      })
      .catch(error => console.error("sorry, something went wrong:" + error))
  }

  render() {
    return (
      <Paper
      style={{padding: "1.2em"}}>
        <Typography variant="h6">
          Now viewing {this.state.userArray.person.name}
        </Typography>  
        <TextField
         variant="outlined"
         label="Search by user"
         margin="dense"
         />
        <ProfileIcons 
        weight={this.state.userArray.person.weight}
        recommendations={this.state.userArray.person.stats.recommendations}
        sent={this.state.userArray.person.stats.recommendationsSent}
        jobs={this.state.userArray.stats.jobs}
        education={this.state.userArray.stats.education}
        strengths={this.state.userArray.stats.strengths}
        />
      </Paper>
    );
  }
